//Import package
import { BrowserRouter } from "react-router-dom";

//Import styles
import "bootstrap/dist/css/bootstrap.min.css";
import "./style/app.css";

//Import Components
import { NavBar, NavVertical } from "./components/Nav";

//Import Pag
import { PagApp } from "./routes/index";
import { HomePage } from "./views";

const App = ()=>{
    return (
        <BrowserRouter>
            <NavBar/>
            <div className="cont container-xl">
                <section>
                    <nav>
                        <NavVertical/>
                    </nav>
                </section>
                <PagApp/>
            </div>
        </BrowserRouter>
    );
};

export default App;
